import React, { Component } from "react";
import cardData from "./matchcards.json";

class App extends Component {
  state = {
    message: "Welcome to my app!",
    cards: [],
  };
  componentDidMount() {
    this.setState({
      cards: [...cardData],
    });
  }

  render() {
    return (
      <div className="App">
        <h1>{this.state.message}</h1>
      </div>
    );
  }
}

export default App;
